package f_RepeatedControl1;

import java.util.Scanner;

public class j125 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int input = sc.nextInt();
		for (int i = 1; i <= input; i++) {
			System.out.printf(i + " ");
		}
		sc.close();
	}

}
